import jsPDF from "jspdf";
import "jspdf-autotable";
import autoTable from "jspdf-autotable"; // Import the function directly

// Ensure the string is inside " " or ' '
const logoBase64 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAA..."; 

const signatureBase64 = "data:image/png;base64,";
const sealBase64 = "data:image/png;base64,";

 

 
 

export const generateQuotationPDF = (data) => {
 const doc = new jsPDF({
    orientation: "portrait",
    unit: "mm",
    format: "a4",
  });

  const pageWidth = doc.internal.pageSize.getWidth();
  const margin = 14;
  const rightX = pageWidth - margin;

  // --- HELPER: Underlined Bold Text ---
  const drawUnderlinedHeader = (text, x, y, size = 10) => {
    doc.setFontSize(size);
    doc.setFont("helvetica", "bold");
    doc.text(text, x, y);
    const textWidth = doc.getTextWidth(text);
    doc.line(x, y + 1, x + textWidth, y + 1); // Exact underline
  };

  // --- HEADER SECTION ---
  doc.setFontSize(16);
  doc.setFont("helvetica", "bold");
  doc.text("V VISHWAKARMA TECHNOLOGIES", margin, 20);
  
  doc.setFontSize(9);
  doc.setFont("helvetica", "normal");
  doc.text("No.34, V.O.C Street, Shanmugapuram, Puducherry-605009", margin, 25);
  doc.text("Mobile: 9994480535 | Email: vishwakatech@gmail.com", margin, 30);
  doc.text(`GSTIN: 34APPPP5696BIZH`, margin, 35);

    // 3. Horizontal Line
  doc.line(margin, 38, 210 - margin, 38);
 

  // --- QUOTATION TITLE (CENTERED & UNDERLINED) ---
  const titleY = 45;
  doc.setFontSize(12);
  doc.setFont("helvetica", "bold");
  doc.text("QUOTATION", pageWidth / 2, titleY, { align: "center" }); // [cite_start]// [cite: 9]
  
  const titleWidth = doc.getTextWidth("QUOTATION");
  doc.line((pageWidth / 2) - (titleWidth / 2), titleY + 1, (pageWidth / 2) + (titleWidth / 2), titleY + 1);

  // --- METADATA SECTION (LEFT & RIGHT) ---
  const metaY = 45;
  doc.setFontSize(10);
  doc.setFont("helvetica", "bold");
  doc.text(`No: ${data.quoteNo || "QID-001"}`, margin, metaY); // [cite_start]// [cite: 2]

  doc.setFont("helvetica", "normal");
  doc.text( `Date: ${new Date(data.date).toLocaleString("en-IN") || ""}`, rightX-50, metaY, { align: "left" }); // [cite_start]// [cite: 10]
  doc.text(`GSTIN: 34APPPP5696BJZH`, rightX-50, metaY + 5, { align: "left" });
  doc.text(`MSME: UDYAM-PY-03-0000752`, rightX-50, metaY + 10, { align: "left" });

  // --- CUSTOMER SECTION ---
  const customerY = 60;
  doc.setFont("helvetica", "bold");
  doc.text("To:", margin, customerY); //[cite_start]// [cite: 3]
  doc.text(data.customerName || "siva", margin, customerY + 5); //[cite_start]// [cite: 4]
  doc.setFont("helvetica", "normal");
  doc.text(`Address: ${data.address || "As per record"}`, margin, customerY + 10); //[cite_start]// [cite: 5]
  // --- ITEMS TABLE (WITH HEADER OUTLINE) ---
  autoTable(doc, {
    startY: customerY + 18,
    margin: { left: margin, right: margin },
     head: [["#", "Description", "HSN Code", "Qty", "Rate", "Total"]], // [cite: 6]
    body: (data.items || []).map((item, index) => [
      index + 1,
      item.description,
      item.hsnCode,
      item.qty,
      parseFloat(item.rate).toFixed(2),
      parseFloat(item.total).toFixed(2)
    ]),
    theme: 'grid', // Force grid lines for outlines
    headStyles: { 
      fillColor: [255, 255, 255], 
      textColor: [0, 0, 0], 
      fontStyle: 'bold',
      lineWidth: 0.2, 
      lineColor: [0, 0, 0] 
    },
    styles: { fontSize: 9, lineColor: [0, 0, 0], lineWidth: 0.1 },
    columnStyles: {
      3: { halign: 'center' },
      4: { halign: 'right' },
      5: { halign: 'right' }
    }
  });

  // --- TOTALS SECTION ---
  let finalY = doc.lastAutoTable.finalY + 10;
  doc.setFontSize(10);
  doc.text(`Sub-Total: Rs. ${data.subTotal || "300"}`, rightX, finalY, { align: "right" }); //[cite_start]// [cite: 17]
  doc.text(`GST (5%): Rs. ${data.taxAmount || "15"}`, rightX, finalY + 6, { align: "right" }); //[cite_start]// [cite: 18]
  doc.setFont("helvetica", "bold");
  doc.text(`Grand Total: Rs. ${data.totalAmount || "315"}`, rightX, finalY + 14, { align: "right" }); // [cite_start]// [cite: 19]



   // --- BANK DETAILS ---
  drawUnderlinedHeader("Bank Details:", margin, finalY);
  const bankData = [
    ["Account Name", ": VISHWAKARMA TECHNOLOGIES"],
    ["Account No", ": 39659642248"],
    ["Bank", ": STATE BANK OF INDIA"],
    ["Branch", ": JIPMER, PUDUCHERRY"],
    ["IFS Code", ": SBIN0002238"],
    ["MICR Code", ": 605002006"]
  ];

  autoTable(doc, {
    startY: finalY + 3,
    margin: { left: margin },
    body: bankData,
    theme: 'plain',
    styles: { fontSize: 8.5, cellPadding: 0.5 },
    columnStyles: { 0: { cellWidth: 30, fontStyle: 'bold' } }
    
  });


// --- NOT IN SCOPE ---
  // finalY += 40; //25
  // if (data.notInScope) {
  //   drawUnderlinedHeader("NOT IN SCOPE:", margin, finalY);
  //   doc.setFont("helvetica", "normal");
  //   doc.setFontSize(9);
  //   doc.text(data.notInScope, margin, finalY + 6);
  //   // finalY += 30;
  // }

 

  // --- TERMS AND CONDITIONS ---
  // let termsY = doc.lastAutoTable.finalY + 28; // + 28
  // drawUnderlinedHeader("TERMS AND CONDITIONS:", margin, termsY);
  // doc.setFont("helvetica", "normal");
  // doc.setFontSize(8);
  // const termsText = [
  //   `Taxes: ${data.terms?.taxes || "Exclusive GST @ 18%"}`,
  //   `Payment: ${data.terms?.payment || "100% Advance"}`
  // ];
  // doc.text(termsText, margin, termsY + 7);


  // --- SIDE-BY-SIDE: SCOPE & TERMS ---
  let sectionY = doc.lastAutoTable.finalY + 15;
  const colWidth = (pageWidth - (margin * 3)) / 2;
  const secondColX = margin + colWidth + margin;

  // 1. NOT IN SCOPE (Left)
  drawUnderlinedHeader("NOT IN SCOPE:", margin, sectionY); 
  doc.setFont("helvetica", "normal");
  doc.setFontSize(8.5);
  const scopeText = data.notInScope || "Standard exclusions apply.";
  const splitScope = doc.splitTextToSize(scopeText, colWidth);
  doc.text(splitScope, margin, sectionY + 7);

  // 2. VERTICAL SEPARATOR LINE
  // const lineStart = sectionY-5;
  // const lineEnd = sectionY + 20;  
  // doc.setLineWidth(0.1);
  // doc.line(pageWidth / 2, lineStart, pageWidth / 2, lineEnd);

  // 3. TERMS AND CONDITIONS (Right)
 drawUnderlinedHeader("TERMS AND CONDITIONS:", secondColX, sectionY); 
  doc.setFont("helvetica", "normal");
  doc.setFontSize(8);
  const termsText = [
    `Taxes: ${data.terms?.taxes || "Exclusive GST @ 18%"}`, 
    `Payment: ${data.terms?.payment || "100% Advance"}` 
  ];
  doc.text(termsText, secondColX, sectionY + 7);

  // --- FOOTER: SIGN & SEAL ---
  const footerY = doc.internal.pageSize.height - 45;

  // Placeholder for Signature/Seal images
  doc.addImage(sealBase64, 'PNG', rightX - 40, footerY + 10, 20, 20);
  doc.addImage(signatureBase64, 'PNG', rightX - 20, footerY + 2, 25, 10);

  // const footerY = doc.internal.pageSize.height - 40;
  doc.text("Thanking You,", margin, footerY); //[cite_start]// [cite: 15]
  doc.text("for VISHWAKARMA TECHNOLOGIES", rightX, footerY, { align: "right" }); //[cite_start]// [cite: 20]
  doc.setFont("helvetica", "bold");
  doc.text("R.Pajany", rightX, footerY + 15, { align: "right" }); //[cite_start]// [cite: 21]
  doc.setFont("helvetica", "normal");
  doc.text("9994480535", rightX, footerY + 20, { align: "right" }); //[cite_start]// [cite: 21]

  // --- PAGE NUMBERING ---
  const pageCount = doc.internal.getNumberOfPages();
  for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.setFontSize(8);
    doc.text(`Page ${i} of ${pageCount}`, pageWidth / 2, 287, { align: "center" });
  }

  doc.save(`Quotation_${data.quoteNo}.pdf`);
};